import java.util.Arrays;
public class day2{
    public static void main(String[] args){
        System.out.print(passcode(""));
        System.out.print(passcode(""));
        System.out.print(passcode(""));
        System.out.print(passcode(""));
    }
    public static String passcode(String nums){
        String[][] keypad = {
            {"1", "2", "3"}, 
            {"4", "5", "6"}, 
            {"7", "8", "9"}
            };
        int row = 1;
        int column = 1;

        for(int i = 0; i < nums.length(); i++){
            if(nums.charAt(i) == 'L' && column > 0){
                column--;
            }
            else if(nums.charAt(i) == 'R' && column < 2){
                column++;
            }
            else if(nums.charAt(i) == 'U' && row > 0){
                row--;
            }
            else if(nums.charAt(i) == 'D' && row < 2){
                row++;
            }
        }
        return keypad[row][column];
    }
}